const sampleImg = "data:image/jpeg;base64,";

function getImg() {
    let img = document.querySelector('.form__img-input');

    if (img.files && img.files[0]) {
        let reader  = new FileReader();
        reader.onloadend = function () {
            let form = document.querySelector('.form'),
                photo = form.querySelector('.form__photo'),
                submitBtn = form.querySelector('.form__submit-btn');
            form.imgForSend = reader.result;

            photo.style.background = 'url("'+reader.result+'") no-repeat center center / cover';
            photo.classList.add('form__photo_filled');
            submitBtn.removeAttribute('disabled');
        };

        reader.readAsDataURL(img.files[0]);
    }

}

function sendImg(form) {
    let data = {
      img: form.imgForSend
    };

    $.ajax({
        type:"POST",
        url:form.getAttribute("action"),
        contentType: 'application/json',
        dataType : "json",
        data:JSON.stringify(data),
        success: function(response){
            fillNewImg(response.img);
        },
        error: function (error) {
            console.log('error');
            fillNewImg(sampleImg);
        }
    });
}

function fillNewImg(base64Img) {
    const img = document.querySelector('.form__photo');
    img.style.background = 'url("'+base64Img+'") no-repeat center center / cover';
    img.classList.add('form__photo_result');
    $('.btn').hide();
}

function switchPage(number) {
    $('[data-page]').each(function () {
        let pageNum = $(this).attr('data-page');
        if(+pageNum === number) {
            $(this).show();
        } else {
            $(this).hide();
        }
    })
}



document.querySelector('.form__img-input').addEventListener('change', getImg);
document.querySelector('.form').addEventListener('submit', function (e) {
    e.preventDefault();
    sendImg(e.target);
});